def decrypt(n, c):
    pt = []
    e = 0
    #pow(ord(m), e, n)
    for x in range(len(c)):
        if x == 0:
            for i in range(500,1000):
                tmp = pow(ord('f'), i, n)
                if tmp == c[0]:
                    e = i
                    break
        for i in range(128):
            tmp = pow(i, e, n)
            if tmp == c[x]:
                pt.append(chr(i))
                break

    return pt

result = decrypt(n, c)
